import styled from 'styled-components';


export const CardArea = styled.div`
  height: 300px;
  background: white;
  width: 200px;
  margin: 40px;
  border-radius: 5px;
  display: inline-block;
  border: 1px solid #e8e8e8;
  &:hover {
    border: none;
    box-shadow: 0 0 20px 3px#e8e8e8;
  }
`;

export const Title = styled.h1`
  color: red;
  text-align: center;
`;
